SET statement_timeout = 0;
SET lock_timeout = 0;
SET client_encoding = 'UTF8';
SET standard_conforming_strings = on;
SET check_function_bodies = false;
SET client_min_messages = warning;
SET search_path = public, pg_catalog;











































































update gl_account g set name = (
select trim(a.name)||' - '||trim(b.name) from gl_account as a
inner join branch as b on a.branch_id=b.id where a.code = g.code and a.branch_id = g.branch_id );

-- new field in GL account table
update gl_account
set financial_year = 2015;



